import React from 'react';
import useLocalStorage from '../UseLocalStorage';

function FormChange(props) {
  let[value, setValue] = useLocalStorage('name','');
return (
  <div>
      <h3>{props.text}</h3>
    <input
    type="text"
    onChange={(event) => setValue(event.target.value)}
    value={value} 
    />
  </div>
);
}
export default FormChange;
